import clientPromise from "../../../components/mongoDB/mongodb";

export default async function image(req, res) {
	// get the tokenID from the URL
	let { tokenID } = req.query;
	tokenID = parseInt(tokenID);

	//find a user with this tokenID in the database
	let user = null;
	try {
		let client = await clientPromise;
		let db = await client.db();
		user = await db.collection("users").findOne({ tokenID: tokenID });
	} catch (error) {
		console.log(error);
		return res.status(500).json({ message: "Internal Server Error" });
	}

	// if there is no user with this tokenID, return 404
	if (!user) {
		return res.status(404).json({ message: "User not found" });
	}

	// display and show the svg image
	res.setHeader("Content-Type", "image/svg+xml");
	res.setHeader("Content-Disposition", "inline");
	res.send(
		`<svg width="1000" height="1000" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
		 <image stroke="null" href="data:image/jpeg;base64," xlink:href="data:image/jpeg;base64," id="svg_3" height="800" width="400" y="100" x="550"/>
		 <rect stroke="null" id="svg_5" height="1000" width="500" y="0" x="0" fill="#8dd5ff"/>
		 <image stroke="null" href="data:image/png;base64," xlink:href="data:image/png;base64," id="svg_6" height="300" width="300" y="10" x="100"/>
		 <line id="svg_7" y2="1000" x2="500" y1="0" x1="500" stroke="#000" fill="none"/>
		 <text stroke="null" xml:space="preserve" text-anchor="start" font-family="'Inter'" font-size="25" stroke-width="0" id="svg_8" y="960" x="38" fill="#061309">${process.env.NEXTAUTH_URL}/NFT/${tokenID}</text>
		 <text stroke="#000" font-weight="bold" xml:space="preserve" text-anchor="start" font-family="'Inter'" font-size="30" id="svg_4" y="360" x="100" stroke-width="0" fill="#000000">${user?.name}'s Data Digital Twin</text>
		 <text stroke="#000" font-weight="normal" xml:space="preserve" text-anchor="start" font-family="'Inter'" font-size="30" id="svg_11" y="430" x="50" stroke-width="0" fill="#000000">${user?.achievements[0]}</text>
		 <text stroke="#000" font-weight="normal" xml:space="preserve" text-anchor="start" font-family="'Inter'" font-size="30" id="svg_10" y="499.91695" x="50" stroke-width="0" fill="#000000">${user?.achievements[1]}</text>
		 <text stroke="#000" font-weight="normal" xml:space="preserve" text-anchor="start" font-family="'Inter'" font-size="30" id="svg_9" y="570" x="50" stroke-width="0" fill="#000000">${user?.achievements[2]}</text>
	   </svg>`
	);
}
